function generateQR() {
    const qrCodeElement = document.getElementById('qr-code')
    const qrCode = new QRCodeStyling(
        {
            "width": 300,
            "height": 300,
            "data": qrCodeElement.innerText,
            "margin": 20,
            "qrOptions": {
              "typeNumber": "0",
              "mode": "Byte",
              "errorCorrectionLevel": "Q"
            },
            "imageOptions": {
              "hideBackgroundDots": true,
              "imageSize": 0.4,
              "margin": 0
            },
            "dotsOptions": {
              "type": "rounded",
              "color": "#6a1a4c",
              "gradient": {
                "type": "linear",
                "rotation": 0,
                "colorStops": [
                  {
                    "offset": 0,
                    "color": "#521800"
                  },
                  {
                    "offset": 1,
                    "color": "#002185"
                  }
                ]
              }
            },
            "backgroundOptions": {
              "color": "#ffffff"
            },
            "image": "data:image/png;base64,",
            "dotsOptionsHelper": {
              "colorType": {
                "single": true,
                "gradient": false
              },
              "gradient": {
                "linear": true,
                "radial": false,
                "color1": "#6a1a4c",
                "color2": "#6a1a4c",
                "rotation": "0"
              }
            },
            "cornersSquareOptions": {
              "type": "extra-rounded",
              "color": "#000000"
            },
            "cornersSquareOptionsHelper": {
              "colorType": {
                "single": true,
                "gradient": false
              },
              "gradient": {
                "linear": true,
                "radial": false,
                "color1": "#000000",
                "color2": "#000000",
                "rotation": "0"
              }
            },
            "cornersDotOptions": {
              "type": "",
              "color": "#000000"
            },
            "cornersDotOptionsHelper": {
              "colorType": {
                "single": true,
                "gradient": false
              },
              "gradient": {
                "linear": true,
                "radial": false,
                "color1": "#000000",
                "color2": "#000000",
                "rotation": "0"
              }
            },
            "backgroundOptionsHelper": {
              "colorType": {
                "single": true,
                "gradient": false
              },
              "gradient": {
                "linear": true,
                "radial": false,
                "color1": "#ffffff",
                "color2": "#ffffff",
                "rotation": "0"
              }
            }
          }
    );
    qrCode.append(document.getElementById("canvas"));
}

document.addEventListener('DOMContentLoaded', generateQR())

